import React from "react";
import styled from "styled-components";

import tripper from "media/image/login_logo.png";

const FindPassword = () => {
  return (
    <React.Fragment>
      <Wrap>
        <Text>비밀번호 찾기</Text>
        <Text2>이메일</Text2>
        <EmailInput placeholder="E-mail" />
        <Button>비밀번호 찾기</Button>
        <Text login>로그인하러 가기</Text>
        <Tripper />
      </Wrap>
    </React.Fragment>
  );
};
export default FindPassword;

const Wrap = styled.div`
  display: flex;
  align-items: center;
  flex-direction: column;
  margin: 0px auto;
  margin-top: 20rem;
  width: 23rem;
`;

const Text = styled.div`
  display: flex;
  justify-content: center;
  font-family: "TTTogether";
  font-size: ${(props) => (props.login ? "1rem" : "1.62rem")};
  width: 23rem;
  margin: 0px auto;
  margin-bottom: 4rem;
  color: ${(props) => (props.login ? "#2B61E1" : "#535353")};
`;

const Text2 = styled.div`
  display: flex;
  align-items: flex-start;
  width: 23rem;
  font-family: "AppleSDGothicNeoR";
  font-size: 0.8rem;
  color: #2b61e1;
  margin-bottom: 0.5rem;
`;

const EmailInput = styled.input`
  font-family: "TTTogether";
  outline: none;
  width: 20rem;
  height: 3rem;
  margin-bottom: 3rem;
  border: ${(props) => props.line};
  border-radius: 5px;
  box-shadow: 0px 3px 6px #00000029;
  padding-left: 1.5rem;
  padding-right: 1.5rem;

  ::placeholder {
    font-family: "TTTogether";
    font-size: 1rem;
    color: #535353;
    opacity: 50%;
  }
`;

const Button = styled.button`
  font-family: "TTTogether";
  font-size: 1rem;
  width: 23.5rem;
  height: 3rem;
  box-shadow: 0px 3px 6px #00000029;
  border: 1px solid #2b61e1;
  border-radius: 5px;
  margin-bottom: 2rem;
  background-color: #2b61e1;
  color: #ffffff;
`;

const Tripper = styled.div`
  width: 370px;
  height: 270px;
  background-image: url("${tripper}");
  background-size: 370px 270px;
  position: absolute;
  clip: rect(0, 370px, 270px, 0);
  margin: 0px auto;
  margin-top: 33rem;
`;
